  "translationLines": [
    {
      "lineNumber": 99181,
      "originalJapaneseLine": "　出て行ってしまうんですか！？」",
      "translatedEnglishLine": "Are you really going to leave!?"
    },
    {
      "lineNumber": 99182,
      "originalJapaneseLine": "「うん」",
      "translatedEnglishLine": "\"Yeah.\""
    },
    {
      "lineNumber": 99183,
      "originalJapaneseLine": "「元々、他の聖女モンスターに会う為に",
      "translatedEnglishLine": "\"Originally, I was with you guys to meet other saint monsters,"
    },
    {
      "lineNumber": 99184,
      "originalJapaneseLine": "　ランス君達と一緒にいたわけだし、",
      "translatedEnglishLine": "so I was with you, Rance and the others,"
    },
    {
      "lineNumber": 99185,
      "originalJapaneseLine": "　他の子に会った以上はもうね」",
      "translatedEnglishLine": "and now that I've met the others, well..."
    },
    {
      "lineNumber": 99186,
      "originalJapaneseLine": "「な、なんだそりゃ？」",
      "translatedEnglishLine": "\"W-what's that supposed to mean?\""
    },
    {
      "lineNumber": 99187,
      "originalJapaneseLine": "「そもそも今までがおかしかったのよ。",
      "translatedEnglishLine": "\"The truth is, things have been strange until now."
    },
    {
      "lineNumber": 99188,
      "originalJapaneseLine": "　聖女モンスターである私が",
      "translatedEnglishLine": "For me, a saint monster,"
    },
    {
      "lineNumber": 99189,
      "originalJapaneseLine": "　人類に協力するなんて」",
      "translatedEnglishLine": "to be cooperating with humans is unusual.\""
    },
    {
      "lineNumber": 99190,
      "originalJapaneseLine": "「人類軍の戦いも軌道に乗ってきたし、",
      "translatedEnglishLine": "\"The human army's fight has gotten on track,"
    },
    {
      "lineNumber": 99191,
      "originalJapaneseLine": "　そろそろ私はいらないかなって」",
      "translatedEnglishLine": "so I think I'm no longer needed.\""
    },
    {
      "lineNumber": 99192,
      "originalJapaneseLine": "「う、それは……」",
      "translatedEnglishLine": "\"U-um, that is...\""
    },
    {
      "lineNumber": 99193,
      "originalJapaneseLine": "「あ、あれ？　そう言われてみると……",
      "translatedEnglishLine": "\"H-huh? Now that you mention it..."
    },
    {
      "lineNumber": 99194,
      "originalJapaneseLine": "　どうして今まで協力を……」",
      "translatedEnglishLine": "why have you been cooperating until now...\""
    },
    {
      "lineNumber": 99195,
      "originalJapaneseLine": "「暇潰し……というのもあるけど」",
      "translatedEnglishLine": "\"Partly to kill time... but also\""
    },
    {
      "lineNumber": 99196,
      "originalJapaneseLine": "「モンスターの進化の為よ」",
      "translatedEnglishLine": "\"for the evolution of monsters.\""
    },
    {
      "lineNumber": 99197,
      "originalJapaneseLine": "「魔物の進化には人間が敵である方が",
      "translatedEnglishLine": "\"For monster evolution, it's better that humans are the enemy,"
    },
    {
      "lineNumber": 99198,
      "originalJapaneseLine": "　色々と都合が良かったから……",
      "translatedEnglishLine": "since that made many things convenient..."
    },
    {
      "lineNumber": 99199,
      "originalJapaneseLine": "　人類には勝って欲しかったの」",
      "translatedEnglishLine": "I actually wanted humanity to win.\""
    },
    {
      "lineNumber": 99200,
      "originalJapaneseLine": "「ただ、これ以上は過干渉だわ」",
      "translatedEnglishLine": "\"But beyond this, it's excessive meddling.\""
    },
    {
      "lineNumber": 99201,
      "originalJapaneseLine": "「むむ、よく分からんが",
      "translatedEnglishLine": "\"Hmm, I don't really understand,"
    },
    {
      "lineNumber": 99202,
      "originalJapaneseLine": "　そんなことどうでもいいではないか……」",
      "translatedEnglishLine": "but does it really matter...\""
    },
    {
      "lineNumber": 99203,
      "originalJapaneseLine": "「後は人類が、",
      "translatedEnglishLine": "\"From now on, humanity"
    },
    {
      "lineNumber": 99204,
      "originalJapaneseLine": "　人類の力だけで戦うべきよ」",
      "translatedEnglishLine": "should fight with human power alone.\""
    },
    {
      "lineNumber": 99205,
      "originalJapaneseLine": "「これから先がどうなるか分からないけど、",
      "translatedEnglishLine": "\"I don't know what will happen going forward,"
    },
    {
      "lineNumber": 99206,
      "originalJapaneseLine": "　少なくとも私の力なんてもう必要ないし……」",
      "translatedEnglishLine": "but at least, my power is no longer necessary...\""
    },
    {
      "lineNumber": 99207,
      "originalJapaneseLine": "「う……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 99208,
      "originalJapaneseLine": "「でも寂しいです……」",
      "translatedEnglishLine": "\"But I feel lonely...\""
    },
    {
      "lineNumber": 99209,
      "originalJapaneseLine": "「ベゼルアイ様とは、",
      "translatedEnglishLine": "\"Because with Lady BezelEye,"
    },
    {
      "lineNumber": 99210,
      "originalJapaneseLine": "　今回ずっと最初から一緒だったので……",
      "translatedEnglishLine": "we have been together from the very beginning this time..."
    },
    {
      "lineNumber": 99211,
      "originalJapaneseLine": "　出来れば最後まで……」",
      "translatedEnglishLine": "I wish to stay till the very end if possible...\""
    },
    {
      "lineNumber": 99212,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 99213,
      "originalJapaneseLine": "「馬鹿ね、泣くことないでしょう？」",
      "translatedEnglishLine": "\"You're silly, no need to cry, right?\""
    },
    {
      "lineNumber": 99214,
      "originalJapaneseLine": "「今生の別れというわけでもあるまいし、",
      "translatedEnglishLine": "\"It's not like we're parting forever in this life,"
    },
    {
      "lineNumber": 99215,
      "originalJapaneseLine": "　落ち着いたらまた遊びに来るわ」",
      "translatedEnglishLine": "I'll come visit you again once things settle down.\""
    },
    {
      "lineNumber": 99216,
      "originalJapaneseLine": "「駄目だーーーー！」",
      "translatedEnglishLine": "\"No wayyyyy!\""
    },
    {
      "lineNumber": 99217,
      "originalJapaneseLine": "「ランス君？」",
      "translatedEnglishLine": "\"Rance-kun?\""
    },
    {
      "lineNumber": 99218,
      "originalJapaneseLine": "「お前は俺がゲットした",
      "translatedEnglishLine": "\"You're a girl monster I got,"
    },
    {
      "lineNumber": 99219,
      "originalJapaneseLine": "　女の子モンスターなんだから",
      "translatedEnglishLine": "a girl monster —"
    },
    {
      "lineNumber": 99220,
      "originalJapaneseLine": "　出て行くのは駄目だ！」",
      "translatedEnglishLine": "You can't leave!\""
    },
    {
      "lineNumber": 99221,
      "originalJapaneseLine": "「大体、帰ってきたときには",
      "translatedEnglishLine": "\"Besides, when you come back,"
    },
    {
      "lineNumber": 99222,
      "originalJapaneseLine": "　またガキの姿に戻ってるんだろうが！」",
      "translatedEnglishLine": "you'll have transformed back into a kid, right!\""
    },
    {
      "lineNumber": 99223,
      "originalJapaneseLine": "「俺は大人姿のベゼルアイと",
      "translatedEnglishLine": "\"I won't be satisfied unless I have sex with adult BezelEye!\""
    },
    {
      "lineNumber": 99224,
      "originalJapaneseLine": "　セックスせんと気が済まんのだ！」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 99225,
      "originalJapaneseLine": "「そんな勝手な……」",
      "translatedEnglishLine": "\"That's so selfish...\""
    },
    {
      "lineNumber": 99226,
      "originalJapaneseLine": "「うう……でも……」",
      "translatedEnglishLine": "\"Ugh... but...\""
    },
    {
      "lineNumber": 99227,
      "originalJapaneseLine": "「むむむ……」",
      "translatedEnglishLine": "\"Mmmmmm...\""
    },
    {
      "lineNumber": 99228,
      "originalJapaneseLine": "「おお、そうだ！　チルディを呼ぼう！",
      "translatedEnglishLine": "\"Oh, that's right! Let's call Tildy!"
    },
    {
      "lineNumber": 99229,
      "originalJapaneseLine": "　あいつに巨大ケーキ作らせるのだ！」",
      "translatedEnglishLine": "I'll have her make a giant cake!\""
    },
    {
      "lineNumber": 99230,
      "originalJapaneseLine": "「え……私、それで残っちゃうイメージ？」",
      "translatedEnglishLine": "\"Eh... Does that mean I'll end up staying?\""
    },
    {
      "lineNumber": 99231,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 99232,
      "originalJapaneseLine": "「はあ……」",
      "translatedEnglishLine": "\"Sigh...\""
    },
    {
      "lineNumber": 99233,
      "originalJapaneseLine": "「泣く子と権力者には勝てないわね」",
      "translatedEnglishLine": "\"You can't win against a crying child and a person in power.\""
    },
    {
      "lineNumber": 99234,
      "originalJapaneseLine": "「え……」",
      "translatedEnglishLine": "\"Eh...?\""
    },
    {
      "lineNumber": 99235,
      "originalJapaneseLine": "「いいわ、残るわ」",
      "translatedEnglishLine": "\"Alright, I'll stay.\""
    },
    {
      "lineNumber": 99236,
      "originalJapaneseLine": "「わっ！」",
      "translatedEnglishLine": "\"Wah!\""
    },
    {
      "lineNumber": 99237,
      "originalJapaneseLine": "「がははは、偉いぞ、よく考え直したな！」",
      "translatedEnglishLine": "\"Hahaha, well done! You've thought it over properly!\""
    },
    {
      "lineNumber": 99238,
      "originalJapaneseLine": "「よし、今日はビスケッタさんに言って、",
      "translatedEnglishLine": "\"Alright, today let's tell Biscetta-san"
    },
    {
      "lineNumber": 99239,
      "originalJapaneseLine": "　なんか甘いの作ってもらうか」",
      "translatedEnglishLine": "to make something sweet for us.\""
    },
    {
      "lineNumber": 99240,
      "originalJapaneseLine": "「……本当は止められると思っていたから",
      "translatedEnglishLine": "\"...Honestly, I thought you could stop me.\""
    }
  ]
}

